import React, {Component} from 'react';

const MandalArtTable = ({value, onChange}) => {

    return (
        <table>
            <tr>
                <td><input value={value} onChange={this.handleChange}/></td>
            </tr>
        </table>
    );
};

export default MandalArtTable;
